import {Link}  from 'react-router-dom';
import { useState, useEffect } from 'react';



  

  const getAllReview = () => {
    fetch("http://localhost:1234/productlist")
      .then((response) => response.json())
      .then((productarray) => {
        updateproduct(productarray.reverse());
      });
  };

  useEffect(() => {
    getAllReview();
  }, [1]);

const Viewfeedback = () =>{
    let[isHidden, setIsHidden] = useState(false);
    let [review, updateproduct] = useState([]);
    return(
     <div>
          <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
          <div className="container-fluid">
         <span className="navbar-brand mb-0 h1">Feedback Portal</span>
           {/* hide the button onclick */}
          <Link to="/Addfeedback" className="menu"> {isHidden && <button className="btn btn-primary" type="submit" onClick={() => setIsHidden(true)}>Add Feedback</button>} </Link>
      </div>
</nav>
<div class="container "> 
             <div className="row mt-5">
                <div className="col-lg-12 text-center fs-1 text-warning menu"> Review </div>
             </div>

                      <div className="row "> 
                        <div className="col-lg-12 p-5 text-center">
                           <div className="btn btn-group">
                          <button className="btn btn-primary text-white fs-6 " style = {{ padding: '4px 15px 4px' }} onclick="all_product()">All</button> 
                            <button className="btn btn-info text-white fs-6" style = {{ padding: '4px 15px 4px' }} onclick="drinks()">Drinks</button> 
                            <button className="btn btn-success text-white fs-6" style = {{ padding: '4px 15px 4px' }} onclick="lunch()">Lunch</button> 
                           <button className="btn btn-warning text-white fs-6" style = {{ padding: '4px 15px 4px' }} onclick="dinner()">Dinner</button> 
                          <button type="button " className="btn btn-danger text-white fs-6"  style = {{ padding: '4px 15px 4px' }}> <a className="text-white" href="#cart" >Cart </a></button>
                          </div>
                          </div>
                      </div>
                      </div>
</div>
    )
}

export default Viewfeedback;
